import React from 'react'
import {RViewerTrigger2,RViewer} from 'react-viewerjs'
function Visualizador(){
    let imagenes = [
        require("../img/Im치genesdeproductos/MIGAS_PIGMENTOS/3.png"),
        require("../img/Im치genesdeproductos/MIGAS_PIGMENTOS/4.png")
    ];
    return(
        <div>
            <RViewer imagenes={imagenes}>
                <div style = {{display:'flex',marginTop:'40px'}}>
                    {imagenes.map((imagen,index)=>{
                        return(
                            <img src={imagen} style = {{width:'15px',height:'150px',marginLeft:'20px'}}></img>
                        )
                    })}
                </div>
            </RViewer>
        </div>
    )

}
